import Vue from "vue";
import Vuex from "vuex";

Vue.use(Vuex);

export default new Vuex.Store({
  state: {
    cryptos: [],
    cryptoValues: [],
  },
  getters: {
    cryptos(state) {
      return state.cryptos;
    },
  },
  mutations: {},
  actions: {},
  modules: {},
});
